// Function node - n8n
// Entrada esperada: $input.first().json.data (string JSON ou objeto)
// Gera saída com a estrutura solicitada (pageIndex, index, markdown, images[])

const raw = $input.first().json.data;
let doc;
try {
  doc = (typeof raw === 'string') ? JSON.parse(raw) : raw;
} catch (err) {
  throw new Error('Não foi possível parsear input.data como JSON: ' + err.message);
}

const pages = doc.pages || [];
const sourceItem = $input.first().json.sourceItem || null; // tenta manter sourceItem se existir
const items = [];

function take(...keys) {
  // retorna a primeira chave existente no objeto
  return function(obj, fallback = null) {
    for (const k of keys) {
      if (obj && (k in obj) && obj[k] != null) return obj[k];
    }
    return fallback;
  };
}

// helpers para diferentes nomes possíveis
const getTopLeftX = take('top_left_x','topLeftX','top_left_x_px','top_left_x_px','top_left.x','x');
const getTopLeftY = take('top_left_y','topLeftY','top_left_y_px','top_left_y_px','top_left.y','y');
const getBottomRightX = take('bottom_right_x','bottomRightX','bottom_right_x_px','bottom_right_x_px','bottom_right.x');
const getBottomRightY = take('bottom_right_y','bottomRightY','bottom_right_y_px','bottom_right_y_px','bottom_right.y');
const getId = take('id','name','fileName','file_name','filename');
const getImageData = take('image_base64','data','imageData','base64');

for (let i = 0; i < pages.length; i++) {
  const page = pages[i] || {};
  const pageIndex = (page.index != null) ? page.index : i;
  const markdown = page.markdown || '';
  const dims = page.dimensions || {};

  const out = {
    json: {
      sourceItem,
      pageIndex,
      index: pageIndex,
      markdown,
      dimensions: dims,
      images: []
    }
  };

  const imgs = Array.isArray(page.images) ? page.images : [];
  for (let j = 0; j < imgs.length; j++) {
    const img = imgs[j] || {};

    const id = getId(img, `img-${pageIndex}-${j}`);
    const tlx = getTopLeftX(img, 0);
    const tly = getTopLeftY(img, 0);
    const brx = getBottomRightX(img, 0);
    const bry = getBottomRightY(img, 0);
    let imgBase64 = getImageData(img, null);

    // se houver campo image_base64 que já começa com data:..., deixa como está
    if (imgBase64 && typeof imgBase64 === 'string' && imgBase64.startsWith('data:')) {
      // ok
    } else if (imgBase64 && typeof imgBase64 === 'string') {
      // tenta detectar mimeType, se informado
      const mime = img.mimeType || img.type || 'image/jpeg';
      // se a string já for base64 cru (sem vírgula), prefixa
      if (!imgBase64.startsWith('data:')) {
        imgBase64 = `data:${mime};base64,${imgBase64}`;
      }
    } else if (img.url) {
      // se só tiver url, coloca a url no campo image_base64 para manter formato visual esperado
      imgBase64 = img.url;
    } else {
      imgBase64 = null;
    }

    out.json.images.push({
      id,
      top_left_x: Number(tlx),
      top_left_y: Number(tly),
      bottom_right_x: Number(brx),
      bottom_right_y: Number(bry),
      image_base64: imgBase64
    });
  }

  items.push(out);
}

return items;
